import React, { Component } from 'react';
import HomeLayout from '../Components/HomeLayout';

export default class Login extends Component {
  render() {
    return (

      <HomeLayout>
        <div className="App-Login">
          <Link to="/login" type="button">Get started</Link>
        </div>
      </HomeLayout>

    )
  }
}
